@Test
    @Sql(
        "classpath:sql/reward-account/standard.sql",
        "classpath:sql/cashback-transaction/standard.sql"
    )
    @MockClock(instant = "2024-01-10T12:00:00.000Z")
    fun `should update transaction and reward account with creditable transaction in day d`() {
        `when`(contractsMicroservice.getMultipleContracts(any())).thenReturn(
            listOf(
                ContractForRewardsResponse(
                    id = UUID.fromString("9af88635-af13-4195-881d-18a7e291d47b"),
                    status = ACTIVE,
                    productId = 10,
                    number = "123",
                    cost = BigDecimal(1_000),
                    paymentFrequency = MONTHLY,
                    signatureDate = LocalDate.of(2023, 12, 1),
                    firstPaymentPaid = true
                )
            )
        )
        `when`(contractsMicroservice.getCancellationsSums(any())).thenReturn(
            listOf(
                ContractCancellationsSumResponse(
                    contractId = UUID.fromString("9af88635-af13-4195-881d-18a7e291d47b"),
                    totalSum = 1,
                    activeSum = 0
                )
            )
        )

        job.execute()

        verify(contractsMicroservice).getMultipleContracts(capture(contractIdsForContractsCaptor))
        verify(contractsMicroservice).getCancellationsSums(capture(contractIdsForCancellationsSumsCaptor))

        assertThat(contractIdsForContractsCaptor.value).containsExactlyInAnyOrder(
            UUID.fromString("9af88635-af13-4195-881d-18a7e291d47b")
        )
        assertThat(contractIdsForCancellationsSumsCaptor.value).containsExactlyInAnyOrder(
            UUID.fromString("9af88635-af13-4195-881d-18a7e291d47b")
        )

        assertCredit(rewardAccountRepository.getByUserIdFetchCashbackTransactions(1))

        assertThat(messages.getAll(CashbackTransactionCreditedMessage::class.java)).hasSize(3)
    }
